/*Table structure for table `administrativo_pessoa_bancario` */

DROP TABLE IF EXISTS `administrativo_pessoa_bancario`;

CREATE TABLE `administrativo_pessoa_bancario` (
  `idpessoa_bancario` int(11) NOT NULL AUTO_INCREMENT,
  `idpessoa` int(11) NOT NULL,
  `idbanco` int(11) NOT NULL,
  `idagencia` int(11) NOT NULL,
  `conta` varchar(50) NOT NULL,
  `observacao` varchar(300) DEFAULT NULL,
  PRIMARY KEY (`idpessoa_bancario`),
  KEY `FK_pessoa_banco` (`idbanco`),
  KEY `FK_pessoa_banco_pessoa` (`idpessoa`),
