/*Table structure for table `sistema_configuracao` */

DROP TABLE IF EXISTS `sistema_configuracao`;

CREATE TABLE `sistema_configuracao` (
  `idconfiguracao` int(11) NOT NULL DEFAULT '0',
  `versao` int(11) DEFAULT NULL,
  `versao_titulo` varchar(50) DEFAULT NULL,
  `iddocumento` int(11) DEFAULT NULL,
  `iddocumento_convenio` int(11) DEFAULT NULL,
  `idplano_conta` int(11) DEFAULT NULL,
  `idplano_conta_convenio` int(11) DEFAULT NULL,
  PRIMARY KEY (`idconfiguracao`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

