/* Procedure structure for procedure `Contas_Cartao` */

/*!50003 DROP PROCEDURE IF EXISTS  `Contas_Cartao` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `Contas_Cartao`(IN vEmpresa INT, IN vData1 DATE, IN vData2 DATE)
BEGIN
  DECLARE Ativo BOOLEAN;
  SELECT 
    Ativo,
    financeiro_contas.idconta,
    financeiro_contas.idagenda,
    financeiro_contas.contrato,
    financeiro_contas.numero_parcela,
    financeiro_contas.data_emissao,
    financeiro_contas.historico,
    clinica_paciente.idpaciente,
    Paciente.nome AS NomePaciente,
    clinica_convenio.idconvenio,
    Convenio.nome AS NomeConvenio,
    financeiro_contas.valor_documento,
    financeiro_contas.data_vencimento,
    financeiro_contas.valor_principal,
    @Atraso := DATEDIFF(CURRENT_DATE(), data_vencimento) AS AtrasoINT,
    CASE
      WHEN @Atraso > 1 
      THEN CONCAT(
        'Venceu a ',
        CAST(@Atraso AS CHAR(50)),
        ' Dias'
      ) 
      WHEN @Atraso = 0 
      THEN 'Vencendo Hoje' 
      WHEN @Atraso = 1 
      THEN 'Venceu Ontem' 
      WHEN @Atraso = - 1 
      THEN 'Vencendo Amanhã' 
      ELSE REPLACE(
        CONCAT(
          'Faltam ',
          CAST(@Atraso AS CHAR(50)),
